import React, { useState, useEffect } from "react";
import { Col, Row, Container, Form, Button } from "react-bootstrap";

//UseHistory
import { useHistory, Link } from "react-router-dom";

//Font Awesome
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCoffee, faCheckSquare } from '@fortawesome/free-solid-svg-icons'

const Login = () => {

  const checkIcon = <FontAwesomeIcon icon={faCheckSquare} size="xs" />
  const history = useHistory();

  function processLogin() {
    console.log("Bora")
    history.push("/principal");
  }

  return (
    <Container fluid>

      <Row >
        <Col>
          Lists
          </Col>

      </Row>


      <Row className="d-flex align-items-center">
        <Col className="d-flex align-items-center">
          <Form>

            <Form.Group className="mb-3" controlId="formBasicEmail">
              <Form.Control placeholder="Usuário" style={{ borderColor: "#FFA052", borderWidht: "1.5px", width: 280 }} />
            </Form.Group>

            <Form.Group className="mb-3" controlId="formBasicEmail">
              <Form.Control placeholder="Senha" style={{ borderColor: "#FFA052", borderWidht: "1.5px", width: 280 }} />
            </Form.Group>

            <Button
              block
              type="submit"
              style={{ backgroundColor: "#FF5252", border: "#FF5252", borderRadius: 5 }}
              onClick={() => processLogin()}
            >
              Vamos lá
              </Button>

          </Form>
        </Col>
      </Row>

    </Container>
  )

}

export default Login;
